import React,{Component} from 'react'

class Content extends Component{
    render(){
        return(
            <ol>
                <li>Bag Lady - Erykah Badu</li>
                <li>Breezeblocks - Alt j</li>
                <li>Disorder - Joy Division</li>
                <li>One - Metallica</li>
                <li>Under Your Spell-Desire</li>
            </ol>
        )
    }
}


export default Content
